          <Route path="/listaContent" element={<ListaContent/>}/>
          <Route path="/favorites">
            {/* <Bla /> */}
          </Route>
          <Route path="/suggestion">
            {/* <User /> */}
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
